import React from 'react'

const SingleBox = ({singleday, clickOnDay}) => {
  return (
    <div onClick={clickOnDay}  className="singlebox"> 
    <h3>Day: {singleday.day}</h3>
    <p>Left appointments: {8 - singleday.hours.length}</p>
    </div>

  )
}

export default SingleBox
